import React from 'react';

export default () => (
  <div className="tracking-steps">
    <span className="dot active" />
    <span className="line" />
    <span className="dot" />
    <span className="line" />
    <span className="dot" />
    <h4 className="tracking-text">Select</h4>
    <h4 className="tracking-text2">Confirm</h4>
    <h4 className="tracking-text3">Buy</h4>
  </div>
);
